tables.table_schema:
CREATE TABLE property (
  id INT PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  address VARCHAR(255) NOT NULL,
  value DECIMAL(10, 2) NOT NULL
);

CREATE TABLE rental (
  id INT PRIMARY KEY,
  property_id INT NOT NULL,
  tenant_name VARCHAR(255) NOT NULL,
  rent DECIMAL(10, 2) NOT NULL
);

CREATE TABLE expense (
  id INT PRIMARY KEY,
  property_id INT NOT NULL,
  category VARCHAR(255) NOT NULL,
  amount DECIMAL(10, 2) NOT NULL
);

CREATE TABLE income (
  id INT PRIMARY KEY,
  property_id INT NOT NULL,
  source VARCHAR(255) NOT NULL,
  amount DECIMAL(10, 2) NOT NULL
);

CREATE TABLE properties (property_id INT PRIMARY KEY, property_name VARCHAR(255) NOT NULL, property_type VARCHAR(50) NOT NULL, property_address VARCHAR(255) NOT NULL, property_value DECIMAL(10, 2) NOT NULL);
CREATE TABLE tenants (tenant_id INT PRIMARY KEY, tenant_name VARCHAR(255) NOT NULL, tenant_contact VARCHAR(20) NOT NULL, tenant_email VARCHAR(255) NOT NULL, property_id INT NOT NULL);
CREATE TABLE leases (lease_id INT PRIMARY KEY, lease_start_date DATE NOT NULL, lease_end_date DATE NOT NULL, tenant_id INT NOT NULL, property_id INT NOT NULL);
CREATE TABLE expenses (expense_id INT PRIMARY KEY, expense_date DATE NOT NULL, expense_description TEXT NOT NULL, expense_amount DECIMAL(10, 2) NOT NULL, property_id INT NOT NULL);
CREATE TABLE revenue (revenue_id INT PRIMARY KEY, revenue_date DATE NOT NULL, revenue_description TEXT NOT NULL, revenue_amount DECIMAL(10, 2) NOT NULL, property_id INT NOT NULL);
